"use strict";

function shortestPalindrome(s) {
    const base = 131;
    const mod = 10**9 + 7;
    const n = s.length;
    let prefix = 0;
    let suffix = 0;
    let mul = 1;
    let idx = 0;
    for (let i = 0; i < n; i++) {
        const c = s[i];
        prefix = (prefix * base + (c.charCodeAt(0) - 'a'.charCodeAt(0) + 1)) % mod;
        suffix = (suffix + (c.charCodeAt(0) - 'a'.charCodeAt(0) + 1) * mul) % mod;
        mul = (mul * base) % mod;
        if (prefix === suffix) {
            idx = i + 1;
        }
    }
    return (idx === n) ? s : s.slice(idx).split('').reverse().join('') + s;
}
